import Link from 'next/link'

class LandingPage extends React.Component {
    render() {
        return (
            <div className="container">
                <div className="background" />
                <div className="overlay" />
                <div className="content">
                    <button>
                        <Link href="/dealer">
                            <button value="Dealer" />
                        </Link>
                    </button>
                    <button>
                        <Link href="/customer">
                            <a>Customer</a>
                        </Link>
                    </button>
                </div>
            </div>
        );
    }
}

export default LandingPage;
